informacaoComplementar:
A palestra terá como temas centrais:
Balanço dos 25 anos da Lei de Responsabilidade Fiscal;
Transparência, prestação de contas e controle da política fiscal;
Impactos do Novo Regime de Contratações Públicas sobre o monitoramento e o controle orçamentário de contratos plurianuais e de duração continuada.
O evento ocorrerá no dia 13 de maio de 2025, no período da manhã, com carga horária de até 3 horas (id 0059034535). Essa palestra faz parte do 3º Encontro de Controles Internos do Poder Executivo de Rondônia, que será realizado presencialmente nos dias 12 e 13 de maio de 2025.

Considerando a Lei Complementar nº 758/2014, em seu artigo 22, § 3º, alínea I, que dispõe sobre a qualificação profissional com finalidade de assegurar a continuidade administrativa e a efetividade do serviço público; 
Considerando que é competência da Controladoria promover a integração das atividades entre as Secretarias de Estado e demais órgãos, nos termos do art. 9º, da Lei Complementar 758/2014;
Considerando o papel fundamental da Controladoria Geral do Estado como órgão central do Sistema de Controle Interno do Poder Executivo Estadual, a CGE-RO assegura a integridade na gestão dos recursos públicos, zelando pelo interesse coletivo e pela probidade na administração de valores, dinheiro e demais ativos do Estado. Além disso, a instituição promove a implementação de medidas eficazes para prevenir e combater a corrupção, além de fomentar a transparência e a integridade na gestão pública.
Nos dias 12 e 13 de maio de 2025, a Controladoria Geral do Estado de Rondônia promoverá o 3º Encontro de Controles Internos do Poder Executivo do Estado de Rondônia, evento voltado à capacitação e ao aperfeiçoamento dos servidores públicos estaduais. Diante da relevância da temática abordada, torna-se necessária a contratação de palestrante especializado para conduzir discussões sobre a Lei nº 12.527/2011 (Lei de Acesso à Informação – LAI) e a Lei nº 13.709/2018 (Lei Geral de Proteção de Dados Pessoais – LGPD).
A contratação de um palestrante com expertise comprovada na área justifica-se pela necessidade de proporcionar aos participantes conhecimento técnicos atualizados e alinhados às melhores práticas de gestão da informação e proteção de dados essenciais para a adequada aplicação das normas e para o fortalecimento da cultura de transparência no serviço público.

Assim, conforme solicitado e autorizado no Memorando nº 11/2025/CGE-GAB (0058872188), surge a necessidade de contratação de um palestrante com domínio sobre essa temática.

